L’edificio, integralmente ristrutturato nel 2015 e conservato in ottimo stato, risulta libero su quattro lati e disposto su quattro livelli. 
E’ ubicato in una strada privata e protetto dal traffico e dai rumori, a pochi passi da un parco ben curato.
Adibito ad ostello, è attualmente distribuito come segue:
piano rialzato: 192,5 mq: reception, zona relax con cucina / sala da pranzo + 4 camere + 4 bagni;
primo piano: 192,5 mq: 5 camere + 5 bagni + zona relax con cucina / sala da pranzo, sala cablaggio;
secondo piano: 169 mq + 11 mq di terrazza: ingresso + tre camere + 4 bagni;
seminterrato: 180 mq + 38 mq di cortile interno: spazio aperto con cucina, lavanderia, bagno per i dipendenti, cortile interno. La superficie principale di questo piano si svilup
